import React from 'react';

function App(){
    return (
    <ol>
        <li>Addition: {add(4, 3)}</li>
        <li>Subtraction: {sub(4, 3)}</li>
        <li>Multiplication: {mult(4, 3)}</li>
        <li>Divide: {div(10, 3)}</li>
    </ol>
    );
}
